import axios from 'axios';
import { async } from 'regenerator-runtime';

const apiBaseUrl = "http://localhost:3001";
const getProduct = async (apiBaseUrl) => {
    const resp = await axios.get(
        `${apiBaseUrl}/products`
    );
    return resp.status === 200 ? resp : false;
}

module.exports = {
    getProduct
}
